import React from "react";
import { motion } from "framer-motion";

const AboutUs = () => {
  // Animation Variants
  const fadeIn = {
    hidden: { opacity: 0 },
    visible: { opacity: 1, transition: { duration: 1.2, ease: "easeInOut" } },
  };

  const stagger = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.2,
        delayChildren: 0.3,
      },
    },
  };

  return (
    <div className="about-us-page" style={styles.container}>
      {/* About Section */}
      <motion.section
        style={styles.section}
        variants={fadeIn}
        initial="hidden"
        animate="visible"
      >
        <motion.div
          style={styles.content}
          variants={stagger}
          initial="hidden"
          animate="visible"
        >
          {/* Image */}
          <motion.div
            style={styles.imageContainer}
            initial={{ scale: 0.8, opacity: 0 }}
            animate={{ scale: 1, opacity: 1 }}
            transition={{ duration: 1.5 }}
          >
            <img
              src="/images/1.jpg"
              alt="Ceylone Engineering Team"
              style={styles.image}
            />
          </motion.div>

          {/* Text Content */}
          <motion.div style={styles.text}>
            <h2>Who We Are</h2>
            <p>
              At Ceylone Engineering, weâ€™ve been crafting top-notch ironworks for
              over 15 years. Our mission is to enhance spaces with durable, elegant, and bespoke iron creations.
            </p>
          </motion.div>
        </motion.div>
      </motion.section>

      {/* Why Choose Us Section */}
      <motion.section
        style={styles.highlightsSection}
        variants={fadeIn}
        initial="hidden"
        animate="visible"
      >
        <h3>Why Choose Us?</h3>
        <p>
          At Ceylone Engineering, we stand out for the following reasons:
        </p>
        <motion.div style={styles.highlights} variants={stagger}>
          {['Expertise', 'Precision', 'Innovation', 'Durability'].map((item, index) => (
            <motion.div
              key={index}
              style={styles.highlight}
              variants={fadeIn}
            >
              <img
                src="/images/7.jpg" // Replace with the right images for each highlight
                alt={item}
                style={styles.icon}
              />
              <h4>{item}</h4>
              <p>
                {item === 'Expertise'
                  ? '15 years of delivering durable, high-quality ironworks.'
                  : item === 'Precision'
                  ? 'Cutting-edge tools and skilled craftsmen.'
                  : item === 'Innovation'
                  ? 'Tailored designs to meet modern construction needs.'
                  : 'Built to withstand the test of time.'}
              </p>
            </motion.div>
          ))}
        </motion.div>
      </motion.section>
    </div>
  );
};

const styles = {
  container: {
    fontFamily: "'Roboto', sans-serif",
    color: "#333",
    backgroundColor: "#f7f7f7",
    padding: "20px",
  },
  section: {
    padding: "40px 20px",
    backgroundColor: "#e2e2e2",
    borderRadius: "10px",
    boxShadow: "0 8px 16px rgba(0, 0, 0, 0.1)",
  },
  content: {
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    justifyContent: "center",
    gap: "20px",
    maxWidth: "1200px",
    margin: "auto",
  },
  imageContainer: {
    width: "100%",
    maxWidth: "600px",
    borderRadius: "15px",
    overflow: "hidden",
    boxShadow: "0px 8px 16px rgba(0, 0, 0, 0.2)",
  },
  image: {
    width: "100%",
    height: "auto",
  },
  text: {
    textAlign: "center",
    maxWidth: "800px",
  },
  highlightsSection: {
    padding: "40px 20px",
    backgroundColor: "#f0f0f0",
    textAlign: "center",
  },
  highlights: {
    display: "flex",
    justifyContent: "center",
    flexWrap: "wrap",
    gap: "20px",
  },
  highlight: {
    flex: "1 1 calc(25% - 20px)",
    maxWidth: "300px",
    padding: "20px",
    backgroundColor: "#fff",
    borderRadius: "10px",
    boxShadow: "0 4px 8px rgba(0, 0, 0, 0.1)",
    textAlign: "center",
    transition: "transform 0.3s ease",
  },
  icon: {
    width: "100%",
    borderRadius: "10px",
    height: "auto",
    marginBottom: "15px",
    boxShadow: "0px 4px 8px rgba(0, 0, 0, 0.1)",
  },
};

export default AboutUs;
